import React from 'react';

class List extends React.Component{

    constructor(props) {
        super(props);
        this.state = {
            items: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:8080/demo/list")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        items: result.items
                    })
                }
            )
    }

    render() {
        const list = this.state.items.map((item) =>
            <ul>{item}</ul>
        );
        return (
            <div>
                {list}
            </div>
        )
    }
}

export default List;
